sources.styles/utils/_mixins.scss:
@mixin hover($_property, $_toValue) {
  transition: #{$_property} 0.3s;

  &:hover {
    #{$_property}: $_toValue;
  }
}

@mixin onDesktop {
  @media(min-width: 1024px) {
    @content;
  }
}

@mixin onTablet {
  @media(min-width: 768px){
    @content;
  }
}

